import React from "react";
import AddMoviePage from "./pages/AddMoviePage";
import { Brow } from "react-router-dom";
import { MovieListPage } from "./pages/MovieListPage";
import { UpdateMovieDetails } from "./pages/UpdateMovieDetails";
function App() {
  return (
    <div>
      <Routes>
        <Route exact path="/" component={<AddMoviePage />} />
        <Route
          exact
          path="/movies/get-movie-list"
          component={<MovieListPage />}
        />
        <Route
          exact
          path="/movies/update-movie"
          component={<UpdateMovieDetails />}
        />
      </Routes>
    </div>
  );
}

export default App;
